import React from "react";
import { Link } from 'react-router-dom';
import { useFetchEmployeeList } from "./hooks/useFetchDetails";

function App() {

  const { employeeList, loading, error } = useFetchEmployeeList();


  return (
    <div className="flex items-center justify-center h-screen">
      <div className="text-center">
        <h1 className="text-4xl font-bold mb-8">Welcome to Admin Dashnboard</h1>
        <nav className="mb-8">
          <Link
            to="/departments"
            className="mr-4 text-blue-500 hover:underline"
          >
            Departments
          </Link>
          <Link to="/employees" className="text-blue-500 hover:underline">
            Employees
          </Link>
        </nav>
      </div>
    </div>
  );
}

export default App;
